import React, { Component } from 'react';
import { Button } from 'reactstrap';

class Bench extends Component {
    constructor(props) {
        super(props)
        this.state = {
            value: [],
            isToggle: false,
        }

        this.handleChange = this.handleChange.bind(this);
        this.warmupClick = this.warmupClick.bind(this);
    }

    handleChange(e) {
        e.preventDefault();
        this.setState({
            value: e.target.value,
        })
    }   

    warmupClick(e) {
        this.setState({
            isToggle: !this.state.isToggle,
        })
    }

    render() {
        
        var weight = this.state.value;
        var mass = "kg";

        return (
            <div>
                Bench: 
                <span>
                    <input onChange={this.handleChange}></input>
                </span>
                <div>
                    <Button className="btn btn-primary"
                            onClick={this.warmupClick}>
                            Warm up
                    </Button>
                    <div>Warm up x5 40% of max: {weight*4/10}{mass}</div>
                    <div>Warm up x5 50% of max: {weight*5/10}{mass}</div>
                    <div>Warm up x3 60% of max: {weight*6/10}{mass}</div>
                </div>
                <div>70%: {this.state.value*7/10}kg</div>
                <div>80%: {this.state.value*8/10}kg</div>
                <div>90%: {this.state.value*9/10}kg</div>







            </div>
        )
    }
}

export default Bench
